import React from 'react';
import Navbar from "./navbar";
import styled from 'styled-components';

const gridContainer = styled.div`
    display: grid;
`

function Home() {
    return (
        <gridContainer>
            <Navbar/>
        </gridContainer>
    );
}

export default Home;
